- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XN\x1CThe Fairfax County Democratic Committee
    is filing monthly in 2008 because it expects gross receipts over $100,000 and
    because it will be engaged in federal election activity this year. The committee
    has one full time employee and one part time employee. The full time employee
    devotes more than 25 percent of his time to federal elections this year, and therefore,
    his salary and benefits are paid entirely with federal funds.  Disbursements for
    employee compensation and related expenses of the part time employee are not reflected
    in this report, as all of his compensated time is devoted to non federal elections.
    With the exception of these two employees, the Committee is staffed entirely with
    volunteers.     The Committee maintains separate bank accounts for its non-federal
    and its federal election receipts and expenditures. Administrative expenses are
    allocable under Federal regulations, and transfers of non federal funds are made
    retroactively to the Federal account. In prior reports, the Committee opted not
    to allocate between accounts. The monthly report for August 2008 reflects that
    36 percent of administrative expenses are allocable to federal funds and 64 percent
    of administrative expenses are transferred into the federal account from the non
    federal account after calculating administrative expenses beginning June 5th and
    ending July 31st. The calculation resulted in a transfer into the Federal account
    on August 5th for the months of June and July. In the future, the Committee will
    allocate administrative expenses between its federal and non federal accounts. "
